import React from "react";
import Nav from "./components/Nav";
import Hero from "./components/Hero";
import Card from "./components/Card";
import Image from "./images/image 12.png"
import Star from "./images/Star 1.png"

export default function App(){
    return(
        <div>
            <Nav />
            <Hero />
            <Card 
                img = {Image}
                star ={Star}
                rating ="5.0"
                people ="(6)"
                country ="USA"
                topic ="Life lessons with Katie Zaferes"
                amount ="From $136"
            />
             <Card 
                img = {Image}
                star ={Star}
                rating ="5.0"
                people ="(30)"
                country ="UK"
                topic ="Learn wedding photography"
                amount ="From $125"
            />
             <Card 
                img = {Image}
                star ={Star}
                rating ="4.8"
                people ="(2)"
                country ="N"
                topic ="Life lessons with Katie Zaferes"
                amount ="From $136"
            />
        </div>
    )
}
